import { useState, useEffect } from 'react';
import './App.css';

function App() {
  let [selectedUser, setSelectedUser] = useState<string | null>(null)

  useEffect(() => {
    if(selectedUser)
      document.title = selectedUser
  }, [selectedUser])

  return (
    <div style={{display:'flex'}}>
      <div>
        <div>
          <input placeholder="search" />
          <button>find</button>
        </div>
        <ul>
          {['dimych','artem'].map(u => <li
            style={{backgroundColor:(selectedUser == u) ? 'gray' : ''}}
            onClick={() => {
            setSelectedUser(u)
          }}>{u}</li>)}
        </ul>
      </div>
      <div>
        <h2>username</h2>
        <div>details</div>
      </div>
    </div>
  );
}

export default App;
